function doFetchCall(n){n.preventDefault();var t=n.target.href;fetch(t,{headers:{"X-Requested-With":"Fetch"},method:"GET"}).then(function(n){if(n.status!==200){console.log("Looks like there was a problem. Status Code: "+n.status);return}n.text().then(function(n){let i=document.getElementById("content");i.innerHTML=n;t.toLowerCase().includes("/home/music")?LoadJavaScript("/js/music-vue.js"):t.toLowerCase().includes("/jobs/create")&&LoadJavaScript("/js/job-vue.js")})}).catch(function(n){console.log("Fetch Error: -S",n)})}function doAjaxCall(n){function r(){alert("An error occurred while transferring the file.")}function u(){let n=document.getElementById("content");n.innerHTML=t.responseText}n.preventDefault();let i=n.target.href,t=new XMLHttpRequest;t.addEventListener("load",u);t.addEventListener("error",r);t.open("GET",i,!0);t.setRequestHeader("X-Requested-With","XMLHttpRequest");t.send(null)}let obj=document.getElementsByClassName("menu");for(i=0;i<obj.length;i++)obj[i].addEventListener("mouseover",function(n){let t=n.target||n.srcElement;t.className="menuEnhanced"}),obj[i].addEventListener("mouseout",function(n){let t=n.target||n.srcElement;t.className="menu"});let ancors=document.getElementsByClassName("doAjax");for(let n=0;n<ancors.length;n++)ancors[n].addEventListener("click",doFetchCall);vm=new Vue({el:"#Nav",data:function(){return{isUser:!1}},computed:{isActive:function(){return{active:this.isUser}}},method:{checkUser:function(){return{isUser}}}});